import React from 'react'
import Button from '@material-ui/core/Button';
import Fab from '@material-ui/core/Fab';
import Check from '@material-ui/icons/CheckBoxOutlineBlankSharp';

const Index = (props) => {
    return <Fab variant="contained" onClick={props.onClick} disabled={props.disabled ? "disabled" : ""} color="primary" className={props.className + " "} aria-label="add">{props.text}</Fab>
}

export default Index;
